import React, { useState } from 'react';
import { useParams } from 'react-router-dom';

function CargoBooking() {
  const { departureCity, arrivalCity } = useParams();
  const [selectedImage, setSelectedImage] = useState(null);

  const handleImageUpload = (event) => {
    const file = event.target.files[0];
    setSelectedImage(file);
  };

  const handleBookCargo = () => {
    // Implement your booking logic here
    // You can send the cargo details (departureCity, arrivalCity) and the selected image to the server
    // Once the booking is complete, you can redirect the user to another page
  };

  return (
    <div>
      <h2>Cargo Booking</h2>
      <p>Departure City: {departureCity}</p>
      <p>Arrival City: {arrivalCity}</p>
      <input type="file" onChange={handleImageUpload} />
      <button onClick={handleBookCargo}>Book Cargo</button>
    </div>
  );
}

export default CargoBooking;
